The first time I saw someone skating was in ‘Back to the Future’. I was living in Anchorage, Alaska at the time and it blew my mind. 
I wanted to reference that feeling I had, so I made these colors of my @lining.official shoe based off inspiration from the clothes Michael J. Fox wore in the movie. Full circle, I now live around the corner and skate that same Burger King parking lot it was filmed in, 3,386 miles away from my hometown of Anchorage…wild 🤓
